subproject.description:
Designed to support peace building in Ethiopia, the project is intended to assist the HoF-House of Federation and MoFA-Ministry of Federal Affairs in:
1.Improving conflict transfromation mechanisms to reduce ethnic/political confrontation and antagonism through technical advisory (for teh formualtion of a National Strategy); training; increased regional cooperation and consolidating a National conlict assessment and mapping;
2.Enhancing civic responsibility by developing a nation-wide peace-building information programme
